import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to={props.adress}>{props.username}</NavLink>
    </div>
  );
};

const Message = (props) => {
  return <div className={s.message}>{props.message}</div>;
};

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogItems}>
        <DialogItem adress="/dialogs/1" username="Viktor" />
        <DialogItem adress="/dialogs/3" username="Alex" />
        <DialogItem adress="/dialogs/2" username="John" />
        <DialogItem adress="/dialogs/4" username="Frank" />
        <DialogItem adress="/dialogs/5" username="Maxim" />
      </div>
      <div className={s.messages}>
        <Message message="Hi" />
        <Message message="How are you doing today?" />
        <Message message="All good. How about you?" />
      </div>
    </div>
  );
};

export default Dialogs;
